import React from 'react';
import { useEffect, useState, useRef } from "react";
import {
  Dialog,
  DialogActions,
  DialogContent,
  DialogContentText,
  Button,
  DialogTitle
} from "@material-ui/core";
import "./index.scss";

const langLogosArray = {
"Android studio": <i class="fab fa-android"></i> ,
"React" :<div></div>
}

export default function DialogProject({showModal,handleClose,content}) {


  return (

      <Dialog
        open={showModal}
        disableBackdropClick
        disableEscapeKeyDown
        aria-labelledby="dialog-title"
        aria-describedby="dialog-description"
        id="dialog-project"
      >
        <div id="dialog-title">
           {content.title}
           <div className="project-img">
           <img src={ content.image}/>
           </div>
        </div>
        <DialogContent>
          <DialogContentText id="dialog-description">
            <div className='lang-logo'>
                <div>
        {langLogosArray[content.lang]}
          {content.lang}
          </div>
          <a className='d-block text-white project-github' href={ content.github}> <i className='fab fa-github fa-lg'></i>
          see on GitHub
          </a>

          </div>
          <div>
          {content.description}
          </div>
          </DialogContentText>
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose} color="primary">
            ok
          </Button>
        </DialogActions>
      </Dialog>
  );
}
